import React from 'react';
import './CarModels.css';  // Import the CSS specific for this page

// Import images
import modelA from '../images/modelA.jpg';
import modelB from '../images/modelB.jpg';
import modelC from '../images/modelC.jpg';
import modelD from '../images/modelD.jpg';
import modelE from '../images/modelE.jpg';

const carModels = [
  { name: 'Model A', description: 'Description for Car Model A', image: 'modelA.jpg' },
  { name: 'Model B', description: 'Description for Car Model B', image: 'modelB.jpg' },
  { name: 'Model C', description: 'Description for Car Model C', image: 'modelC.jpg' },
  { name: 'Model D', description: 'Description for Car Model D', image: 'modelD.jpg' },
  { name: 'Model E', description: 'Description for Car Model E', image: 'modelE.jpg' },
];

const CarModels = () => {
  return (
    <div className="car-models-page">
      <h2>Car Models</h2>
      <div className="car-models-list">
        {carModels.map((car, index) => (
          <div key={index} className="car-model">
            <img src={`../images/${car.image}`} alt={car.name} className="car-model-image" />
            <h3>{car.name}</h3>
            <p>{car.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CarModels;
